import './App.css';
import Header from './components/Header';
import Navbar from './components/Navbar';


//компонента App
function App() {
	return (
		<div className="app-wrapper">
			<Header />
			<Navbar />
			<div className="content">
				<img src="https://hatrabbits.com/wp-content/uploads/2017/01/random.jpg">
				</img>
				<p>
					Text
				</p>
			</div>
		</div>
	);
}

export default App;
